    return(
        <div className="App-Playbar" style={{width:"30%"}}>
            <button className="App-play"><i class="material-icons">play_arrow</i></button>
            <button className="App-pause"><i class="material-icons">pause</i></button>
            <button className="App-stop"><i class="material-icons">stop</i></button>
            <button className="App-record"><i class="material-icons">fiber_manual_record</i></button>     
        </div>
    );

}
